import Conversation from '../components/conversation'

const ConversationList = (props) => {





        return (
         <Fragment>
          <div className='conversation-list' >
         {props.conversationList.map(conversation =>
           <Conversation
             key= {conversation.id}
             convo= {conversation}
             />)}
          </div>
        </Fragment>
   )
  }





export default ConversationList;
